import React, { useState } from "react";
import axios from "axios";

const PlaceOrder = () => {
  const [symbol, setSymbol] = useState("BTCUSDT");
  const [side, setSide] = useState("BUY");
  const [orderType, setOrderType] = useState("MARKET");
  const [quantity, setQuantity] = useState(0.001);
  const [status, setStatus] = useState(null);
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);

  const handlePlaceOrder = async () => {
    if (quantity <= 0) {
      setError("Quantity must be greater than 0.");
      return;
    }

    setLoading(true);
    setError(null);
    setStatus(null);

    try {
      const response = await axios.post("http://localhost:5000/api/place-order", {
        symbol,
        side,
        type: orderType,
        quantity,
      });

      setStatus(response.data);
    } catch (err) {
      setError("Failed to place the order. Please try again.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="bg-gray-800 p-6 rounded-lg shadow-lg text-white max-w-md mx-auto">
      <h2 className="text-2xl font-bold mb-4">Place Order</h2>

      <div className="mb-3">
        <label className="block mb-1">Symbol:</label>
        <input
          type="text"
          value={symbol}
          onChange={(e) => setSymbol(e.target.value)}
          className="w-full p-2 rounded bg-gray-700 border border-gray-600"
        />
      </div>

      <div className="mb-3">
        <label className="block mb-1">Side:</label>
        <select
          value={side}
          onChange={(e) => setSide(e.target.value)}
          className="w-full p-2 rounded bg-gray-700 border border-gray-600"
        >
          <option value="BUY">BUY</option>
          <option value="SELL">SELL</option>
        </select>
      </div>

      <div className="mb-3">
        <label className="block mb-1">Order Type:</label>
        <select
          value={orderType}
          onChange={(e) => setOrderType(e.target.value)}
          className="w-full p-2 rounded bg-gray-700 border border-gray-600"
        >
          <option value="MARKET">MARKET</option>
          <option value="LIMIT">LIMIT</option>
        </select>
      </div>

      <div className="mb-3">
        <label className="block mb-1">Quantity:</label>
        <input
          type="number"
          value={quantity}
          onChange={(e) => setQuantity(parseFloat(e.target.value) || 0)}
          className="w-full p-2 rounded bg-gray-700 border border-gray-600"
        />
      </div>

      <button
        onClick={handlePlaceOrder}
        disabled={loading}
        className="w-full p-2 bg-yellow-500 text-black font-bold rounded hover:bg-yellow-600"
      >
        {loading ? "Placing Order..." : "Place Order"}
      </button>

      {status && (
        <div className="mt-4 p-3 bg-green-600 rounded">
          <h3 className="font-bold">Order Status:</h3>
          <pre className="text-sm">{JSON.stringify(status, null, 2)}</pre>
        </div>
      )}

      {error && (
        <p className="mt-4 p-2 bg-red-600 text-white rounded">{error}</p>
      )}
    </div>
  );
};

export default PlaceOrder;
